import React from 'react';
import { Create, SimpleForm, TextInput, NumberInput,DateInput } from 'react-admin';


function userList(props){
    return(
        <Create title="Add you users here..." {...props}>
            <SimpleForm>    
                <TextInput source="Enter Full Name" />
                <TextInput source="Enter Username" />
                <TextInput source="Enter User Email address" />
                <TextInput source="Enter User Address" />
                <NumberInput source="Enter UserPhone Number" />
                
            </SimpleForm>
        </Create>
    )
}
export default userList;
